export default function dateRomania(date) {
  let dateToFormat = new Date(date);
  let day = dateToFormat.getDay()+1;
  let month = dateToFormat.getMonth()+1
  let year = dateToFormat.getFullYear();
  console.log(month);
  return day+"."+month+"."+year;
}
